import React from "react";

export class CartItem{
    id: number;
    quantity: number;
    price: number;

    constructor(id:number, quantity:number, price:number) {
        this.id = id;
        this.quantity = quantity;
        this.price = price;
    }
}

export const CartArr = [] as CartItem[];

export const CartContext = React.createContext(CartArr);
